    false,nt"url": null,nt"notes": "This narrative report for Pablo National
    Wildlife Refuge outlines Refuge accomplishments from May to August 1961.The report
    begins by summarizing the weather conditions, water conditions, habitat conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds,  furbearers, predators, rodents, raptors, fish, reptiles, and disease-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and wildfires. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes recreational uses.
    Items of interest and N-R forms are attached.",nt"license_title": "License
